import React from "react";

const WaitList = () => {
  return (
    <>
      <div class="bg-black text-white text-center py-24">
        <h1 class="text-7xl font-semibold mb-4">
          Make AI work for <span class="text-pink-500">your</span>{" "}
          <span class="text-purple-500">brand</span>
        </h1>
        <h2 class="text-7xl font-semibold mb-20">from today.</h2>
        <button className=" bg-black text-white text-lg font-semibold py-4 px-16  rounded-full border border-gray-700">
          Join Waitlist
        </button>
      </div>
    </>
  );
};

export default WaitList;
